import React, { Component } from 'react';

import Todo from './Todo';

function TodoList({todoItems, setTodoItems}){

    return (
        <div id="todoContainer">
            <ul id="todoListed">
             {todoItems.map((todo) =>(
               <Todo 
                setTodoItems={setTodoItems} 
                todoItems={todoItems} 
                key={todo.id} 
                text={todo.text}
                todo={todo}/>
             ))}
            </ul>
       </div>
    );
  }

export default TodoList;
